window.bookSummaryJSON = "<p>Being a trailblazer is tough, especially when you're talking about something as big as the next stage of human evolution. Every answer brings a ton of new questions. But as one of the first to chart this course, Raven keeps shouldering that responsibility, pushing forward and blazing a trail for himself and his buddies.</p> <p>New challenges. Fresh discoveries. Exciting opportunities. Every step he takes adds to his wealth of experience, building up his inner strength. That's the kind of strength he needs to crack the System's secrets wide open. One day, he'll be so powerful that any mystery or confusion will crumble with just a look from him. But until then, he's going all out to make sure those who've got his back don't get lost in the unknown.</p>"; 
